import React from 'react';
import './../styles/Nav.css';

function Nav() {
  return (
    <div className="nav">
      <img
        src="https://logos-world.net/wp-content/uploads/2020/04/Netflix-Logo.png"
        alt="Netlfix Logo"
      />
      <h1>This is the nav</h1>
    </div>
  );
}

export default Nav;
